Nodejs, Mongodb follow/unfollow request<p>I'am making an social web app where user can follow each other and have followers and following option. I coded all the logic for follow but the problem is one user can follow same user again and again as many time user want but I want one user can follow other only one time not more than that How It can be done? Here below is my code.</p>

<p><strong>userschema</strong></p>

<pre><code>const mongoose = require('mongoose');
const Schema = mongoose.Schema;

var UserSchema = new Schema({
    name:{
        type:String,
        required:true
    },
    email:{
        type:String,
        required:true
    },
    password:{
        type:String,
        required:true
    },
    avatar:{
        type:String,
    },
    following: [
        { 
            type: Schema.ObjectId, 
            ref: 'User' 
        },

    ],
    followers: [
        { 
            type: Schema.ObjectId, 
            ref: 'User' 
        }
    ],
    date:{
        type:Date,
        default: Date.now
    },
});

module.exports = mongoose.model("User", UserSchema);
</code></pre>

<p><strong>user router</strong></p>

<pre><code>router.post("/user/:user_id/follow-user",  passport.authenticate("jwt", { session:false}), (req,res) =&gt; {
    User.findById(req.params.user_id)
        .then(user =&gt; {
            user.followers.push(req.user._id);
            var followedUser = user._id;
            user.save()
            User.findOne({ email: req.user.email })
                .then(user =&gt; {
                    user.following.push(followedUser);
                    user.save().then(user =&gt; res.json(user))
                })
                .catch(err =&gt; console.log(err))
        })
})
</code></pre>

